// RemarkIn applies the In predicate on the "remark" field.
func RemarkIn(vs ...string) predicate.Topic {
	v := make([]interface{}, len(vs))
	for i := range v {
		v[i] = vs[i]
	}
	return predicate.Topic(func(s *sql.Selector) {
		s.Where(sql.In(s.C(FieldRemark), v...))
	})
}

